import React from 'react';

export const block_2 = (props) =>{

    return(
                <div className = "mainp" id = "mainp">
                    <h1>Название</h1>
                    <input type = "text" id = "shablon_title" name='Shablon_title' autoFocus={true}></input>
                    <h1>Тип опроса</h1>
                    <select id ="typeselect" name='shablontype'>
                        <option value="public">Публичный</option>
                        <option value="anon">Анонимный</option>
                    </select>
                        {
                            props.items_c.map((item) => {
                                return(
                                    <QPool 
                                    id={item.id} 
                                    key={item.id}
                                    type={item.question_type}
                                    text={item.question_text}
                                    answ={item.answer}
                                    image_delete={require('../images/close.png')}
                                    onDeleted={deleteitem}
                                    setInfo={SetQuestion}>
                                    </QPool>
                                );
                            })
                        }
                    
                    <button id="addtask" onClick={props.additem}>
                        <img src={require('../images/plus.png')} alt='add'></img>
                        <h1>Добавить вопрос</h1>
                    </button>
                    <button id="addtask" onClick={props.SaveShablon}>
                        <h1>Сохранить</h1>
                    </button>
                </div>
    );
}
